CREATE TABLE users (
	id INTEGER NOT NULL, 
	uuid VARCHAR, 
	username VARCHAR NOT NULL, 
	email VARCHAR NOT NULL, 
	hashed_password VARCHAR NOT NULL, 
	full_name VARCHAR, 
	is_active BOOLEAN, 
	admin BOOLEAN, 
	created_at DATETIME, 
	totp_secret VARCHAR, 
	totp_enabled BOOLEAN, 
	webauthn_credentials TEXT, 
	webauthn_enabled BOOLEAN, 
	webauthn_challenge VARCHAR, 
	api_key_hash VARCHAR, 
	api_key_created DATETIME, 
	oauth2_provider VARCHAR, 
	oauth2_id VARCHAR, 
	oauth2_access_token TEXT, 
	oauth2_refresh_token TEXT, 
	oauth2_token_expires DATETIME, 
	saml_name_id VARCHAR, 
	saml_session_index VARCHAR, 
	ldap_dn VARCHAR, 
	kerberos_principal VARCHAR, 
	client_cert_serial VARCHAR, 
	client_cert_issuer VARCHAR, 
	last_login DATETIME, 
	last_login_method VARCHAR, 
	PRIMARY KEY (id)
);
