CREATE TABLE oof_settings (
	id INTEGER NOT NULL, 
	uuid VARCHAR, 
	user_id INTEGER NOT NULL, 
	oof_state INTEGER NOT NULL, 
	start_time DATETIME, 
	end_time DATETIME, 
	internal_message TEXT, 
	internal_enabled BOOLEAN, 
	external_message TEXT, 
	external_enabled BOOLEAN, 
	external_audience INTEGER, 
	reply_once_per_sender BOOLEAN, 
	replied_to_senders TEXT, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (user_id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE emails (
	id INTEGER NOT NULL, 
	uuid VARCHAR, 
	subject VARCHAR NOT NULL, 
	body TEXT, 
	body_html TEXT, 
	mime_content TEXT, 
	mime_content_type VARCHAR, 
	sender_id INTEGER, 
	recipient_id INTEGER, 
	is_read BOOLEAN, 
	is_deleted BOOLEAN, 
	is_external BOOLEAN, 
	external_sender VARCHAR, 
	external_recipient VARCHAR, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(sender_id) REFERENCES users (id), 
	FOREIGN KEY(recipient_id) REFERENCES users (id)
);
