INSERT INTO emails VALUES(3,'84e953b7-71a7-4517-a9f5-13b9f8153b47','FW: נחל שורק VPN למצלמות במוקד',unistr('בברכה,\u000d\u000aשטרום יהונתן,\u000d\u000a\u000d\u000a[cid:image001.png@01DC40DE.02C785E0]\u000d\u000a\u000d\u000aFrom: Michal Kapulsky <michal@trot.co.il>\u000d\u000aSent: Sunday, October 19, 2025 9:37\u000d\u000aTo: TROT Inc. - Yaron Kalimian <yaron@trot.co.il>; TROT Inc. - Chen Gafner <chen@trot.co.il>\u000d\u000aCc: Report <Reports@trot.co.il>\u000d\u000aSubject: RE: נחל שורק VPN למצלמות במוקד\u000d\u000a\u000d\u000aבוקר טוב,\u000d\u000a\u000d\u000aחן – חכה עם המייל, רק היום תצא הצעת מחיר לבת שבע על החידוש הזה..\u000d\u000aהם היו בחופש מעל שבועיים\u000d\u000a\u000d\u000aהיום היא תקבל הצעה, נראה מתי תאשר\u000d\u000a\u000d\u000aבברכה,\u000d\u000a\u000d\u000aמיכל קפולסקי,\u000d\u000a\u000d\u000a[cid:image003.png@01DC40DB.F4F3DBF0]\u000d\u000a\u000d\u000aFrom: TROT Inc. - Yaron Kalimian <yaron@trot.co.il<mailto:yaron@trot.co.il>>\u000d\u000aSent: Sunday, October 19, 2025 9:36 AM\u000d\u000aTo: TROT Inc. - Chen Gafner‏ <chen@trot.co.il<mailto:chen@trot.co.il>>\u000d\u000aCc: Report‏ <Reports@trot.co.il<mailto:Reports@trot.co.il>>\u000d\u000aSubject: FW: נחל שורק VPN למצלמות במוקד\u000d\u000a\u000d\u000aבוקר טוב,\u000d\u000a\u000d\u000aהאם הם חידשו שירות ל- Firewall?\u000d\u000a\u000d\u000aבמידה ולא, חן – תוכל לענות לכולם כתשובה למייל שאתה מבקש להזכיר שלמכשיר אין שירות ואחריות?\u000d\u000a\u000d\u000aבברכה,\u000d\u000a\u000d\u000aירון כלימיאן, מנכ"ל\u000d\u000a[cid:image004.jpg@01DC40DB.F4F3DBF0]\u000d\u000a\u000d\u000aFrom: Yehonatan Abadi <Yehonatan@cyberintegrity.co.il<mailto:Yehonatan@cyberintegrity.co.il>>\u000d\u000aSent: Sunday, October 19, 2025 9:14 AM\u000d\u000aTo: TROT Inc. - Chen Gafner‏ <chen@trot.co.il<mailto:chen@trot.co.il>>; support‏ <support@ma-soreq.org.il<mailto:support@ma-soreq.org.il>>\u000d\u000aCc: Report‏ <reports@trot.co.il<mailto:reports@trot.co.il>>; Victoria Gubanov‏ <victoriag@cyberintegrity.co.il<mailto:victoriag@cyberintegrity.co.il>>; Integrity‏ <CyberIntegrity@cyberintegrity.co.il<mailto:CyberIntegrity@cyberintegrity.co.il>>; Michael Botnik‏ <michael@cyberintegrity.co.il<mailto:michael@cyberintegrity.co.il>>; מורי בת שבע‏ <batsheva@ma-soreq.org.il<mailto:batsheva@ma-soreq.org.il>>; יהודית אמיר‏ <judit@ma-soreq.org.il<mailto:judit@ma-soreq.org.il>>\u000d\u000aSubject: נחל שורק VPN למצלמות במוקד\u000d\u000a\u000d\u000aבהמשך לפגישה בנושא:\u000d\u000aהמשימה כבר בטיפול בצד הלקוח. פרטים:\u000d\u000a\u000d\u000a  *   טרוט (חן) לקחו שליטה על הפורטיגייט של המוקד והתחילו לנהל אותו כפי שתואר במיילים קודמים בנושא.\u000d\u000a  *   בנושא VPN למצלמות במוקד – בטיפול מול ערן מLIQUID360.\u000d\u000a     *   לפני הפגישה נשלח לו מייל תזכורת בנושא.\u000d\u000a\u000d\u000aלכל שאלה ניתן לפנות לצוות אינטגריטי במייל או בוואצאפ.\u000d\u000aבברכה,\u000d\u000a[cid:image005.png@01DC40DB.F4F3DBF0]'),unistr('<html xmlns:v="urn:schemas-microsoft-com:vml" xmlns:o="urn:schemas-microsoft-com:office:office" xmlns:w="urn:schemas-microsoft-com:office:word" xmlns:m="http://schemas.microsoft.com/office/2004/12/omml" xmlns="http://www.w3.org/TR/REC-html40">\u000d\u000a<head>\u000d\u000a<meta http-equiv="Content-Type" content="text/html; charset=utf-8">\u000d\u000a<meta name="Generator" content="Microsoft Word 15 (filtered medium)">\u000d\u000a<!--[if !mso]><style>v\\:* {behavior:url(#default#VML);}\u000d\u000ao\\:* {behavior:url(#default#VML);}\u000d\u000aw\\:* {behavior:url(#default#VML);}\u000d\u000a.shape {behavior:url(#default#VML);}\u000d\u000a</style><![endif]--><style><!--\u000d\u000a/* Font Definitions */\u000d\u000a@font-face\u000d\u000a\u0009{font-family:Wingdings;\u000d\u000a\u0009panose-1:5 0 0 0 0 0 0 0 0 0;}\u000d\u000a@font-face\u000d\u000a\u0009{font-family:"Cambria Math";\u000d\u000a\u0009panose-1:2 4 5 3 5 4 6 3 2 4;}\u000d\u000a@font-face\u000d\u000a\u0009{font-family:Calibri;\u000d\u000a\u0009panose-1:2 15 5 2 2 2 4 3 2 4;}\u000d\u000a@font-face\u000d\u000a\u0009{font-family:Aptos;}\u000d\u000a@font-face\u00