<u><span style="color:blue"><a href="mailto:orna@mesh.co.il">orna@mesh.co.il</a></span></u><span style="color:black">&gt;<br>\u000d\u000a<b>Subject:</b>&nbsp;FW: <span lang="HE" dir="RTL">מכון משגב</span></span><o:p></o:p></p>\u000d\u000a<p>&nbsp;<o:p></o:p></p>\u000d\u000a</div>\u000d\u000a<p dir="RTL" style="text-align:right;direction:rtl;unicode-bidi:embed"><span lang="HE" style="font-family:&quot;Tahoma&quot;,sans-serif">יכולה למצוא?</span><span dir="LTR"><o:p></o:p></span></p>\u000d\u000a<p dir="RTL" style="text-align:right;direction:rtl;unicode-bidi:embed"><span dir="RTL"></span><span dir="RTL"></span><span lang="HE"><span dir="RTL"></span><span dir="RTL"></span>&nbsp;</span><span dir="LTR"><o:p></o:p></span></p>\u000d\u000a<p dir="RTL" style="text-align:right;direction:rtl;unicode-bidi:embed"><span dir="LTR"><img border="0" width="252" height="135" style="width:2.625in;height:1.4062in" id="x_x_תמונה_x0020_2" src="cid:image003.jpg@01DC40DB.DCA02310"></span><span dir="LTR"><o:p></o:p></span></p>\u000d\u000a<p dir="RTL" style="text-align:right;direction:rtl;unicode-bidi:embed"><span dir="RTL"></span><span dir="RTL"></span><span lang="HE"><span dir="RTL"></span><span dir="RTL"></span>&nbsp;</span><span dir="LTR"><o:p></o:p></span></p>\u000d\u000a<div style="border:none;border-top:solid windowtext 1.0pt;padding:3.0pt 0in 0in 0in;border-color:currentcolor currentcolor">\u000d\u000a<p><b>From:</b> <u><span style="color:blue"><a href="mailto:weinberg.david@gmail.com">weinberg.david@gmail.com</a></span></u>&nbsp;&lt;<u><span style="color:blue"><a href="mailto:weinberg.david@gmail.com">weinberg.david@gmail.com</a></span></u>&gt;<br>\u000d\u000a<b>Sent:</b>&nbsp;Thursday, October 16, 2025 9:20 AM<br>\u000d\u000a<b>To:</b>&nbsp;Sarit Dermer<span dir="RTL"></span><span dir="RTL"></span><span lang="HE" dir="RTL"><span dir="RTL"></span><span dir="RTL"></span>‏\u000d\u000a</span><span dir="LTR"></span><span dir="LTR"></span><span dir="LTR"></span><span dir="LTR"></span>&lt;<