CREATE TABLE activesync_devices (
	id INTEGER NOT NULL, 
	uuid VARCHAR, 
	user_id INTEGER NOT NULL, 
	device_id VARCHAR NOT NULL, 
	device_type VARCHAR, 
	policy_key VARCHAR, 
	is_provisioned INTEGER, 
	last_seen DATETIME, 
	created_at DATETIME, 
	PRIMARY KEY (id), 
